import { createTheme } from '@mui/material/styles';

const darkBlue = "hsl(209, 23%, 22%)"
const veryDarkBlue ="hsl(207, 26%, 17%)"
const veryDarkBlueText = "hsl(200, 15%, 8%)"
const darkGray = "hsl(0, 0%, 52%)"
const lightGray = "hsl(0, 0%, 98%)"
const white = "hsl(0, 0%, 100%)"

const theme = createTheme({
  palette: {
    type: 'light',
    common: {
      darkBlue: `${darkBlue}`,
      veryDarkBlue: `${veryDarkBlue}`,
      veryDarkBlueText: `${veryDarkBlueText}`,
      darkGray: `${darkGray}`,
      lightGray: `${lightGray}`,
      white: `${white}`
    },
    primary: {
      main: `${darkBlue}`,
    },
    secondary: {
      main: `${lightGray}`
    },
    text: {
      primary: `${veryDarkBlueText}`
    }
  },
  typography: {
    fontFamily: "Nunito Sans",
    body2: {
      fontFamily: "Nunito Sans",
      fontSize: 14,
      ontWeightLight: 300
    },
    h6: {      
      fontFamily: "Nunito Sans",
      fontWeightBold: 600, 
    },
    body3: {
      fontFamily: "Nunito Sans",
      fontSize: 16,
      ontWeightLight: 300
    },
  },
});

export default theme;
